&lt;canvas id=&quot;grafico&quot; width=&quot;400&quot; height=&quot;300&quot;&gt;&lt;/canvas&gt;
&lt;script type=&quot;text/javascript&quot;&gt;
    /* function datos(tipo) {
        let enti = new Array(); */
    let prueba

    var select = document.getElementById(&#039;select&#039;);
    let chart

    select.addEventListener(&#039;change&#039;,
        function() {
            var selectedOption = this.options[select.selectedIndex];
            console.log(selectedOption.text)
            $.ajax({
                type: &quot;GET&quot;,
                async: false,
                url: `https://mindicador.cl/api/${selectedOption.text}`,
                dataType: &quot;json&quot;,

                success: function(data) {

                    console.log(data)

                    let fecha = new Array()
                    let valor = new Array()

                    $.each(data.serie, function(i, item) {
                        fecha.push(item.fecha)
                        valor.push(item.valor)
                    })
                    console.log(valor)
                    const grafico = document.getElementById(&#039;grafico&#039;).getContext(&#039;2d&#039;);
                    if (chart) {
                        chart.destroy();
                    }
                    chart = new Chart(grafico, {
                        type: &quot;bar&quot;,
                        data: {
                            labels: fecha,
                            datasets: [{
                                label: data.nombre,
                                backgroundColor: &quot;rgb(0,0,0)&quot;,
                                borderColor: &quot;rgb(0,255,0)&quot;,
                                data: valor
                            }]
                        }
                    })
                },
            });
        });
&lt;/script&gt;
